import React, { useState } from "react";
import "./HomeProduct.css";
import Iphone14pro from "../assets/Products/Iphone 14 pro.png";

export default function HomeProduct() {
  const [productData, setProductData] = useState([1, 2, 3, 4, 5, 6, 7, 8]);

  return (
    <div className="">
      <div className="homeCardHeading">
        <p className="homeCardHeadingText">New Arrival</p>
        <p className="homeCardHeadingText">Bestseller</p>
        <p className="homeCardHeadingText">Featured Products</p>
      </div>
      <div className="homeCardItems">
        {productData.map(() => (
          <div className="homeCard">
            <img src={Iphone14pro} />
            <p className="homeProductName">
              Apple Iphone 14 Pro Max 128GB Deep Purple (MQ9T3RX/A)
            </p>
            <p className="homeProductPrice">$900</p>
            <a className="buyNowHomeBtn">Buy Now</a>
          </div>
        ))}
      </div>
    </div>
  );
}
